import React from "react";

const PopupTabs = (props) => {
    return(
        <div className="display_flex space_between flex_align_center">
              {props.tabsList.length > 0 && props.tabsList.map((tab) => {
                  return(
                      <div>
                          <p>
                              {tab}
                          </p>
                      </div>
                  )
              })}
        </div>
    );
}

export default PopupTabs;
